import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
// import { Toaster } from "react-hot-toast";

// ✅ Import your user-facing pages
import Home from "./components/pages/Home";
import About from "./components/pages/About";
import Contact from "./components/pages/Contact";
// import Flights from "./components/pages/Flights";
// import Hotels from "./components/pages/Hotels";
import NotFound from "./components/pages/NotFound";
import Results from "./components/pages/Results";
import FlightDetail from "./components/pages/FlightDetail";
import EnquiryForm from "./components/pages/EnquiryForm";
import Login from "./components/pages/Login";
import Dashboard from "./components/pages/Dashboard";
import OtpVerification from "./components/pages/OtpVerification";
import Features from "./components/pages/Features";
import ThankYou from "./components/pages/ThankYou";
import HowItWorks from "./components/pages/HowItWorks";
import Policy from "./components/pages/Policy";
import TermsConditions from "./components/pages/TermsConditions";
import UserProfile from "./components/pages/UserProfile";
import ReturnFlights from "./components/pages/ReturnFlights";
import Faq from "./components/pages/Faq";
import DealsList from "./components/pages/DealsList";
import DealsSearchResults from "./components/pages/DealsSearchResults";


function Layout() {
  return (
    <div className="App">
      {/* <Toaster position="top-center" /> */}
      <div className="container">
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/deals" element={<DealsList />} />
          <Route path="/about" element={<About />} />
          {/* <Route path="/flights" element={<Flights />} />
          <Route path="/hotels" element={<Hotels />} /> */}
          <Route path="/features" element={<Features />} />
          <Route path="/contact" element={<Contact />} />
          <Route path="*" element={<NotFound />} />
          <Route path="/results" element={<Results />} />
          <Route path="/flights/:id" element={<FlightDetail />} />
          <Route path="/enquiry" element={<EnquiryForm />} />
          <Route path="/login" element={<Login />} />
          <Route path="/signup" element={<Login />} />
          <Route path="/dashboard" element={<Dashboard />} />
          <Route path="/otp-verification" element={<OtpVerification />} />
          <Route path="/thank-you" element={<ThankYou />} />
          <Route path="/how-it-works" element={<HowItWorks />} />
          <Route path="/policy" element={<Policy />} />
          <Route path="/terms" element={<TermsConditions />} />
          <Route path="/profile" element={<UserProfile />} />
          <Route path="/return-flights" element={<ReturnFlights />} />
          <Route path="/faq" element={<Faq />} />
          <Route path="/deals-search" element={<DealsSearchResults />} />
        </Routes>
      </div>
    </div>
  );
}

function App() {
  return (
    <Router>
      <Layout />
    </Router>
  );
}

export default App;
